import axios from 'axios';
import dispatchUsers from '../dispatchUsers/dispatchUsers';

const fetchUsers = () => {
  return dispatch => {
    axios.get('http://vidyaback.appelloproject.xyz/api/users/')
    .then(response => {
        console.log(response)
    })
  }
}

export default fetchUsers
